import React from 'react'
import CookieService from '../Services/CookieService'

const cookie = new CookieService();
class Test{


    sett(){
        cookie.set('name', 'Sachin', {path: '/'})
    }

    gett(){
        cookie.get()
    }

    render() {
            {this.gett()}
    }

}


export default Test
